import React from "react";

function PlantCard({prop}) {
  return (
    <li className="card">
      <img src={prop.image} alt={"plant name"} />
      <h4>{prop.name}</h4>
      {prop.picked ? (
        <button className="primary">Remove</button>
      ) : (
        <button>Add to Pick List</button>
      )}
    </li>
  );
}

export default PlantCard;
